import React from 'react';
import {FaBars} from 'react-icons/fa'
import {Nav, NavbarContainer, NavLogo, MobileIcon, NavMenu, NavItem, NavLinks} from './NavbarElements';

const Navbar = () => {
  return (
    <>
      <Nav>
        <NavbarContainer>
          <NavLogo to = '/'>curis</NavLogo>
          <MobileIcon><FaBars /></MobileIcon>
          <NavMenu>
            <NavItem>
              <NavLinks to='learn_more'>Learn More</NavLinks>
            </NavItem>
            <NavItem>
              <NavLinks to='projects'>Our Projects</NavLinks>
            </NavItem>
            <NavItem>
              <NavLinks to='team'>The Team</NavLinks>
            </NavItem>
          </NavMenu>
        </NavbarContainer>
      </Nav>
    </>
  );
};

export default Navbar;
